  filesize: 1 GB
  releases:
  - DR8
  - DR9
  - DR10
  - DR12
  - DR11
  - DR13
  - DR14
  - DR15
  - DR16
  - DR17
  environments:
  - SSPP_REDUX
  naming_convention: <code>ssppOut-dr[0-9]+\.fits</code>, where <code>[0-9]+</code>
    is the data release number.
  generated_by: sas
